sprites.onOverlap(SpriteKind.MediumP, SpriteKind.Tutorial, function (sprite, otherSprite) {
    otherSprite.destroy(effects.disintegrate, 100)
    music.smallCrash.play()
})
sprites.onOverlap(SpriteKind.SmallP, SpriteKind.Enemy, function (sprite, otherSprite) {
    sprite.destroy(effects.disintegrate, 100)
    otherSprite.destroy(effects.disintegrate, 100)
    info.changeScoreBy(1)
    music.smallCrash.play()
})
statusbars.onZero(StatusBarKind.EnemyHealth, function (status) {
    status.spriteAttachedTo().destroy(effects.disintegrate, 500)
    music.bigCrash.play()
})
