sprites.onDestroyed(SpriteKind.Invincible, function (sprite) {
    deadBoss += 1
    mySprite.sayText("Boss Defeated!", 2000, true)
    maxHealth = sprites.createProjectileFromSprite(img`
        . . . . . a a a a a a . . . . . 
        . . . a a c c 7 7 c c a a . . . 
        . . a 7 c c c 7 7 c c c 7 a . . 
        . a 7 7 7 c c 7 7 c c 7 7 7 a . 
        . a c 7 7 7 c 7 7 c 7 7 7 c a . 
        a c c c 7 7 7 1 1 7 7 7 c c c a 
        a c c c c 7 7 1 1 7 7 c c c c a 
        a 7 7 7 7 1 1 1 1 1 1 7 7 7 7 a 
        a 7 7 7 7 1 1 1 1 1 1 7 7 7 7 a 
        a c c c c 7 7 1 1 7 7 c c c c a 
        a c c c 7 7 7 1 1 7 7 7 c c c a 
        . a c 7 7 7 c 7 7 c 7 7 7 c a . 
        . a 7 7 7 c c 7 7 c c 7 7 7 a . 
        . . a 7 c c c 7 7 c c c 7 a . . 
        . . . a a c c 7 7 c c a a . . . 
        . . . . . a a a a a a . . . . . 
        `, sprite, 0, 10)
    maxHealth.setKind(SpriteKind.PowerUp4)
    timer.after(2000, function () {
        Wave += 1
        mySprite.sayText("Next Wave!", 1000, true)
    })
})
sprites.onOverlap(SpriteKind.ChargedP, SpriteKind.Enemy, function (sprite, otherSprite) {
    otherSprite.destroy(effects.disintegrate, 100)
    info.changeScoreBy(1)
    music.smallCrash.play()
})
function HeartPower () {
    music.baDing.play()
    healthBar.value += 1
}
sprites.onOverlap(SpriteKind.Player, SpriteKind.PowerUp4, function (sprite, otherSprite) {
    otherSprite.destroy()
    healthBar.max += 5
    healthBar.value += 10
    mySprite.sayText(":D", 1000, false)
    chargeSpeed += 5
    music.beamUp.play()
})
